import styled from "styled-components";

const ModalStyled = styled.div`
  display: flex;
  position: fixed;
  top: 50%;
  left: 30%;
  transform: translate(-50%);
  width: 500px;
  height: 500px;
  z-index: 3;
  background-color: black;
`;

export default ModalStyled;
